INSERT  INTO `diagnosis_item`(`diagnosis_item_no`,`diagnosis_cate_no`,`diagnosis_code`,`name`,`service_msg`,`memo`,`enabled`,`reg_date`,`upd_date`,`del_date`) VALUES 
(1, 1, 'IGN001', '점화계통 이상 또는 연료 농후 상황', '1) 점화계통 및 인젝터 리크 등의 점검과 연료피드백상태 확인이 필요할 수 있습니다.\n2) PCV 또는 PCSV의 고착상태의 점검이 필요할 수 있습니다.\n3) 연료 농후에 따른 배기가스 과다 배출과 연비저하, 촉매열화의 가능성이 있습니다.',NULL,1,NOW(),NULL,NULL),
(2, 2, 'INJ001', '연료계통 이상', '1) 연료레일압력이 낮습니다.\n2) 연료펌프와 필터 또는 1,2차 솔레노이드의 점검이 필요합니다.\n3) 가속불량, 엔진멈춤, 시동지연이 발생할 수 있습니다.',NULL,1,NOW(),NULL,NULL),
(3, 3, 'MCN001', '엔진기계계통 이상 또는 연료 희박 상황', '1) 지속적 연료 희박이 감지되어 공연비 이상에 따른 NOx배출의 원인이 됩니다.\n2) 점화플러그 간극 과대의 가능성이 있습니다.\n3) 헤드밸브와 엔진기계시스템 이상에 따른 기밀유지불량이나 이상공기유입 상태 확인이 필요할 수 있습니다.\n4) 삼원 촉매장치 효율저하 및 머플러 파손상태 확인이 필요할 수 있습니다.',NULL,1,NOW(),NULL,NULL),
(4, 4, 'CTR001', '엔진제어 이상', '1) 엔진 제어계통의 이상으로 배기가스 과다 발산 및 엔진 멈춤과 연비 저하의 원인이 됩니다.\n2) DTC를 참고하여 점검정비가 필요합니다.',NULL,1,NOW(),NULL,NULL),
(5, 5, 'TIR001', '타이어 압력(운전석 측 앞바퀴)', '1) 타이어의 압력이 이하로 낮아 점검이 필요합니다.\n2) 조향핸들의 쏠림 현상과 편제동의 원인이 될 수 있습니다.',NULL,1,NOW(),NULL,NULL),
(6, 5, 'TIR002', '타이어 압력(조수석 측 앞바퀴)', '1) 타이어의 압력이 이하로 낮아 점검이 필요합니다.\n2) 조향핸들의 쏠림 현상과 편제동의 원인이 될 수 있습니다.',NULL,1,NOW(),NULL,NULL),
(7, 5, 'TIR003', '타이어 압력(운전석 측 뒷바퀴)', '1) 타이어의 압력이 이하로 낮아 점검이 필요합니다.\n2) 조향핸들의 쏠림 현상과 편제동의 원인이 될 수 있습니다.',NULL,1,NOW(),NULL,NULL),
(8, 5, 'TIR004', '타이어 압력(조수석 측 뒷바퀴)', '1) 타이어의 압력이 이하로 낮아 점검이 필요합니다.\n2) 조향핸들의 쏠림 현상과 편제동의 원인이 될 수 있습니다.',NULL,1,NOW(),NULL,NULL),
(9, 7, 'CLT001', '냉각수 과열', '1) 엔진과열로 냉각호스 파손 및 엔진소결(고착)이 원인이 될 수 있습니다.\n2) 냉각팬 구동상태 및 냉각시스템 막힘확인이 필요합니다.',NULL,1,NOW(),NULL,NULL),
(10, 6, 'GNT001', '충전상태 불안정', '1) 차량의 충전(발전) 상태가 불안정합니다.\n2) 밸트 및 제너레이터(충전시스템)의 점검정비가 필요합니다.',NULL,1,NOW(),NULL,NULL);
